import * as actions from '../conponents/action/action'


const initState = {
    name: ""
}

const reducer =(state = initState,action) =>{

    switch(action.type)
    {
        case actions.GET_P_USER:
        return{
        ...state,
        name:action.name
        }
        case actions.GET_P_TOKEN:
        {
            return{
                ...state,
                name: action.name
            }
        }
        default:
            return state;
    }


}

export default reducer;
